import './App.css';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import {useState, useEffect} from 'react';

function App() {
  let [data,setData] = useState([])
useEffect(() => {
  data.map((d1)=> <li>{d1}</li>)
}, [data])

  const addMore = (event) =>{
      let val = [...data,event.target.value];
      setData(val)
    }
  return (
    <div className="App">
      <header className="App-header">
        <h1>THINGS TO DO</h1>
        <div style={{display:"block"}}>
        <TextField fullWidth id="outlined-basic" label="Add More" variant="outlined"   style={{alignContent:'center'}} />
        <Button variant="contained" onClick={(event) => addMore(event)}>Add More</Button>

        </div>
      </header>
    </div>
  );
}

export default App;
